import React, { Component } from 'react'
import { NavLink } from 'react-router-dom';
import './navbar.css'

class NavBar extends Component{
  state = {
    klassDropdown: false
  }

  handleKlassDropdownClick = () => {
    this.setState({
      ...this.state,
      klassDrowndown: !this.state.klassDropdown
    })
  }

  render(){
    return (
      <div className="navbar">
        <NavLink to="/">Home</NavLink>
        <NavLink to="/classes">Classes Index</NavLink>
        <div
          className="klass-dropdown"
          onClick={this.handleKlassDropdownClick}
          >Classes Dropdown
        </div>
        <NavLink to="/progressions/new">New Progression</NavLink>
        <NavLink to="/progressions">All Progressions</NavLink>
      </div>
    )
  }

}

function handleKlassDropdownClick(klasses){
  return (
    <h1>HI!</h1>
  )
}


export default NavBar
